import React, { useEffect, useState } from 'react';
import { auth, signWithGoogle } from '../Firebase/Config';

const Login = () => {
 
  return (
    <div>
      <h3>Login Page</h3>

      <button onClick={signWithGoogle}>Login</button>
      <button onClick={() => auth.signOut()}>signOut</button>
    </div>
  );
};

export default Login;
